script: |
  super -f text -I q11100.spq | sort > q11100.out

inputs:
  - name: q11100.spq
    data: |
      SELECT - col2 + col0 FROM tab0 (FORMAT parquet) WHERE - col2 - + ( 45 ) NOT BETWEEN - - ( col1 ) + 42 AND col2;
  - name: tab0

outputs:
  - name: q11100.out
    data: |
      -2
      -32
      77
